content:
Meus respeitos a família do menino e nem sou especialista para tirar qualquer conclusão, mas como pai, me preocuparia com alguns cuidados a serem dispensados aos nossos filhos, tais como:
- Conversar mais e não simplesmente deixá-los aos cuidados de jogos eletrônicos;
- Ser para "eles" o seu melhor amigo;
- Orar a cada dia, para esse nosso mundo possa ser modificado, sem violência e que os valores da família possam ser resgatados.
